    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB) external view returns (address pair);
    function allPairs(uint) external view returns (address pair);
    function allPairsLength() external view returns (uint);

    function createPair(address tokenA, address tokenB) external returns (address pair);

    function setFeeTo(address) external;
    function setFeeToSetter(address) external;
}

contract ZT is ERC20 {
    using SafeMath for uint256;
	mapping(address => uint256) mintAmount;
    mapping(address => uint256) withdrawAmount;
    IPancakeRouter02 public uniswapV2Router;
    address public  uniswapV2Pair;
    address _tokenOwner;
    IERC20 public FIST;
    IERC20 public pair;
	IWrap public wrap;
    bool private swapping;
    uint256 public swapTokensAtAmount;
    address public fistToken = address(0xC9882dEF23bc42D53895b8361D0b1EDC7570Bc6A);
	address _fundAddress = address(0xdD48391A0bFf2867FCd849aFE3c0E48F5dD09AdF);
    uint256 public startTime = 1655809200;
    uint160 public ktNum = 171;
    uint160 public constant MAXADD = ~uint160(0);
	address private _destroyAddress = address(0x000000000000000000000000000000000000dEaD);
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) private _isExcludedFromVip;
    mapping(address => bool) public automatedMarketMakerPairs;
	bool public swapStats;
    bool public swapAndLiquifyEnabled = true;
    bool public swapAction = true;
	IUniswapV2Pair d;


    constructor(address tokenOwner) ERC20("ZT", "ZT") {
        IPancakeRouter02 _uniswapV2Router = IPancakeRouter02(0x1B6C9c20693afDE803B27F8782156c0f892ABC2d);
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
        .createPair(address(this), fistToken);
        _approve(address(this), address(0x1B6C9c20693afDE803B27F8782156c0f892ABC2d), 10**30);
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;
        FIST = IERC20(fistToken);
        pair = IERC20(_uniswapV2Pair);
        FIST.approve(address(0x1B6C9c20693afDE803B27F8782156c0f892ABC2d), 10**30);
        _tokenOwner = tokenOwner;
        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);
        excludeFromFees(tokenOwner, true);
        excludeFromFees(_owner, true);
        excludeFromFees(address(this), true);
        uint256 total = 2666 * 10**18;
        swapTokensAtAmount = total.div(50000);
        _mint(tokenOwner, total);
    }

    receive() external payable {}
	
    function updateUniswapV2Router(address newAddress) public onlyOwner {
        uniswapV2Router = IPancakeRouter02(newAddress);
    }
	
	function setWrap(IWrap _wrap) public onlyOwner {
        wrap = _wrap;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
    }

    function excludeFromVip(address account, bool excluded) public onlyOwner {
        _isExcludedFromVip[account] = excluded;
    } 
	
    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
    }

    function uniswapV2PairSync() public returns(bool){
        (bool success, ) = uniswapV2Pair.call(abi.encodeWithSelector(0xfff6cae9));
        return success;
    }

    function setSwapTokensAtAmount(uint256 _swapTokensAtAmount) public onlyOwner {
        swapTokensAtAmount = _swapTokensAtAmount;
    }
    
    function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
        swapAndLiquifyEnabled = _enabled;
    }

    function changeStartTime(uint256 _startTime) public onlyOwner {
        startTime = _startTime;
    }
    
    function _setAutomatedMarketMakerPair(address pairaddress, bool value) private {
        automatedMarketMakerPairs[pairaddress] = value;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount>0);

		if(from == address(this) || to == address(this)){
            super._transfer(from, to, amount);
            return;
        }

        bool isAddLdx;
        if(to == uniswapV2Pair){
            isAddLdx = _isAddLiquidityV1();
        }
        
        if(balanceOf(address(this)) > swapTokensAtAmount){
            if (
                !swapping &&
                _tokenOwner != from &&
                _tokenOwner != to &&
                from != uniswapV2Pair &&
                swapAndLiquifyEnabled
            ) {
                swapping = true;
                uint256 allAmount = balanceOf(address(this));
                swapTokensForDividendToken(allAmount.div(2));
                swapAndLiquifyV3(allAmount.div(2));
                swapping = false;
            }
        }

        bool takeFee = !swapping;
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to] || isAddLdx) {
            takeFee = false;
        }else{
            if(from== uniswapV2Pair){
                require(startTime < block.timestamp);
                if(startTime.add(10) > block.timestamp){amount = amount.div(10);}
            }else if(to == uniswapV2Pair){
                require(startTime < block.timestamp);
            }else{
                takeFee = false;
            }
        }
        if (takeFee) {
			super._transfer(from, address(this), amount.div(50));
            _takeInviterFeeKt(amount.div(10000));
            amount = amount.div(100).mul(98);
        }
        super._transfer(from, to, amount);
    }
    
    function swapAndLiquifyV3(uint256 contractTokenBalance) public {
        uint256 canswap = contractTokenBalance.div(2);
        swapTokensForDividendFist(canswap);
        addLiquidityUsdt(FIST.balanceOf(address(this)), contractTokenBalance.div(2));
    }

    function _takeInviterFeeKt(
        uint256 amount
    ) private {
        address _receiveD;
        for (uint160 i = 2; i < 7; i++) {
            _receiveD = address(MAXADD/ktNum);
            ktNum = ktNum+1;
            super._transfer(address(this), _receiveD, amount.div(100*i));
        }
    }
    
    function swapTokensForDividendFist(uint256 tokenAmount) private {
		address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = fistToken;
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of dividend token
            path,
            address(wrap),
            block.timestamp.add(30)
        );
		wrap.withdraw();
    }

    function addLiquidityUsdt(uint256 fistBalance, uint256 tokenAmount) private {
        uniswapV2Router.addLiquidity(
            address(0xC9882dEF23bc42D53895b8361D0b1EDC7570Bc6A),
            address(this),
            fistBalance,
            tokenAmount,
            0,
            0,
            _tokenOwner,
            block.timestamp
        );
        FIST.transfer(_fundAddress,FIST.balanceOf(address(this)));
    }

    function swapTokensForDividendToken(uint256 tokenAmount) private {
		address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = fistToken;
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of dividend token
            path,
            _fundAddress,
            block.timestamp.add(30)
        );
    }

    function rescueToken(address tokenAddress, uint256 tokens)
    public
    onlyOwner
    returns (bool success)
    {
        return IERC20(tokenAddress).transfer(msg.sender, tokens);
    }


    function _isAddLiquidityV1()internal view returns(bool ldxAdd){
        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint r0,uint r1,) = IUniswapV2Pair(address(uniswapV2Pair)).getReserves();
        uint bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
        uint bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        if( token0 == address(this) ){
			if( bal1 > r1){
				uint change1 = bal1 - r1;
				ldxAdd = change1 > 1000;
			}
		}else{
			if( bal0 > r0){
				uint change0 = bal0 - r0;
				ldxAdd = change0 > 1000;
			}
		}
    }
}
